import React, { Component } from 'react';

class Interface extends Component {
  constructor(props) {
    super(props);
    this.state = {
      login_username: "",
      login_password: "",
      regis_username: "",
      regis_password: ""
    };
  }

  handleUserLoginChange = event => {
    event.preventDefault()
    this.setState({ login_username: event.target.value });
  }

  handlePasswordLoginChange = event => {
    event.preventDefault()
    this.setState({ login_password: event.target.value });
  }

  handleUserRegisChange = event => {
    event.preventDefault()
    this.setState({ regis_username: event.target.value });
  }

  handlePasswordRegisChange = event => {
    event.preventDefault()
    this.setState({ regis_password: event.target.value });
  }

  callLogin() {
    $.ajax({
      url: 'http://localhost:4000/login',
      type: 'GET',
      contentType: "application/json; charset=utf-8",
      crossDomain: true,
      dataType: 'json',
      xhrFields: { withCredentials: true },
      success: (data) => {
        if (data.message === 'OK') {
          this.setState({ redirectRef: true });
        } else {
          this.setState({ redirectRef: false });
        }
      }
    });
  }

  callRegister() {
    $.ajax({
      url: 'http://localhost:4000/register',
      type: 'GET',
      contentType: "application/json; charset=utf-8",
      crossDomain: true,
      dataType: 'json',
      xhrFields: { withCredentials: true },
      success: (data) => {
        if (data.message === 'OK') {
          this.setState({ redirectRef: true });
        } else {
          this.setState({ redirectRef: false });
        }
      }
    });
  }

  callEnrollAdmin() {
    $.ajax({
      url: 'http://localhost:4000/enroll',
      type: 'GET',
      contentType: "application/json; charset=utf-8",
      crossDomain: true,
      dataType: 'json',
      xhrFields: { withCredentials: true },
      success: (data) => {
        if (data.message === 'OK') {
          this.setState({ redirectRef: true });
        } else {
          this.setState({ redirectRef: false });
        }
      }
    });
  }

  render() {
    return (
      <div className="interface">
        <div className="loginForm">
          <input type="text" className="loginFormField" placeholder="Username" onChange={this.handleUserLoginChange} />
          <input type="password" className="loginFormField" placeholder="Password" onChange={this.handlePasswordLoginChange} />
          <input type="submit" value="Login"></input>
        </div>
        <div className="registerUserForm">
          <input type="text" className="regFormField" placeholder="Username" onChange={this.handleUserChange} />
          <input type="password" className="regFormField" placeholder="Password" onChange={this.handlePasswordChange} />
          <input type="submit" value="Register"></input>
        </div>
        <div className="enrollAdminForm">
          <button id="enroll_user">Enroll Admin</button>
        </div>
      </div>
    );
  }
}

export default Interface;
